INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1001, 0, 0, 1, 1.4, 0, "お！\nあそこに困ってそうな人発見！", 1, "春咲 ひより", 2, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1002, 0, 0, 1, 1.4, 0, "大切な人を\n守れるようになりたい…って", 1, "草野 優衣", 2, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, "みんなみたいに\nわたしも強くならなきゃ");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1003, 0, 0, 1, 1.4, 0, "キミに必要な集中力と感性が", 1, "士条 怜", 2, "少しは磨かれると思いますよ。", 1, "フェンシングを始めてみては？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1004, 0, 0, 1, 1.5, 0, "今日はなにして遊ぶ？", 1, "穂高 みそぎ", 2, "みそぎはねぇ、\nかくれんぼやりたい！", 1, "ねぇ、にいちゃん！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1006, 0, 0, 1, 1.4, 0, "ねぇ…", 1, "風宮 あかり", 2, "私といっしょに…\nいかない？", 1, "風宮あかりです");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1007, 0, 0, 1, 1.5, 0, "プリンたべたいのー", 1, "出雲 宮子", 2, "食べ物の恨みは怖いのー", 1, "出雲宮子なのー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1008, 0, 0, 1, 1.4, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, "虹村 雪", 2, "いいよ。\n見られることは運命さ…", 1, "ボクは虹村雪。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1009, 0, 0, 1, 1.4, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, "柊杏奈", 2, "人呼んで「疾風の冥姫」!!", 1, "フッ…聞いて後悔するがいい！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1010, 0, 0, 1, 1.5, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, "姫宮 真歩", 2, "ほんまおおきにやわ～♪", 1, "マホマホ王国のプリンセス、\nまほ姫どす");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1011, 0, 0, 1, 1.4, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, "衣之咲 璃乃", 2, "ここで会ったが\n100年目～！", 1, "衣之咲璃乃です！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1012, 0, 0, 1, 1.4, 0, "ち、超能力って…\n何のことかな～？", 1, "柏崎 初音", 2, "…って、お願い！\n誰にも言わないでおいて～！", 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1016, 0, 0, 1, 1.4, 0, "一応カリスマ読モJKやってまっす！", 1, "美波 鈴奈", 2, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, "ちょす！\n美波鈴奈だよ～♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1017, 0, 0, 1, 1.4, 0, "東京は遊園地みたいなところさー", 1, "喜屋武 香織", 2, "でも、沖縄もとってもいいとこさー", 1, "はいたーい。\n喜屋武香織さー。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1018, 0, 0, 1, 1.4, 0, "先生って呼ばれるのは\nくすぐったいから", 1, "支倉 伊緒", 2, "イオちゃんって呼んでね。", 1, "支倉伊緒です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1020, 0, 0, 1, 1.5, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, "茜 ミミ", 2, "ミミをおいてかないでぇ～", 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1021, 0, 0, 1, 1.5, 0, "あの……\nふぇ……", 1, "栗林 くるみ", 2, "ふぇぇぇぇぇん……", 1, "あ…あの…えっと…\n栗…林…くるみ…です……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1022, 0, 0, 1, 1.4, 0, "こんな私に貴重な時間を\n割いていただき、", 1, "風宮 より", 2, "なんてありがとうございます！", 1, "風宮よりです。\nあああああ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1023, 0, 0, 1, 1.5, 0, "おにいちゃんどこいくの？\nえ？", 1, "北条 綾音", 2, "私こっち行きたいー\nね、早く早くー", 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1025, 0, 0, 1, 1.4, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, "天野 すずめ", 2, "これて何か違う…\nあああすみません！", 1, "わっ…わっ…私、\n天野すずめといいます！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1027, 0, 0, 1, 1.4, 0, "あなたは…運命の……\n伴侶……", 1, "倉石 恵理子", 2, "離しませんわ………\n絶対に…!!", 1, "……クスクス…私は\n…倉石恵理子……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1028, 0, 0, 1, 1.4, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, "佐々木 咲恋", 2, "…そうでしょ？？", 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1029, 0, 0, 1, 1.4, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, "桜井 望", 2, "あはは、\n私もまだまだだなぁ～", 1, "桜井望だよ！\nよろしくねっ");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1030, 0, 0, 1, 1.4, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, "ニノン・ジュベール", 2, "ショーグン、\nワタシと一緒に天下統一デース！", 1, "デケデケデンっ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1031, 0, 0, 1, 1.4, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, "上喜 しのぶ", 2, "おかしいですね……", 1, "上喜しのぶです。\n手元のドクロが父です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1033, 0, 0, 1, 1.5, 0, "けんども\nそれには足りないモンが…", 1, "野戸まひる", 2, "そう、\nオラのボケに突っ込める相方が…！", 1, "目指すはビッグな\nお笑い芸人だっぺ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1034, 0, 0, 1, 1.4, 0, "ちょっと緊張しちゃって…", 1, "綾瀬 ゆかり", 2, "ちょ\nちょっと一杯飲んできます…！", 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1036, 0, 0, 1, 1.5, 0, "知らない人とは話しちゃいけないので", 1, "氷川 鏡華", 2, "これ以上お話しすることは…\nないです！", 1, "氷川鏡華…です");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1038, 0, 0, 1, 1.4, 0, "……あ、アラーム。", 1, "柏崎 栞", 2, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, "柏崎…栞です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1040, 0, 0, 1, 1.4, 0, "私、一人も友達がいなくて……", 1, "双葉 碧", 2, "野に咲く花が、\n唯一の話相手です。", 1, "ふ、双葉碧です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1042, 0, 0, 1, 1.4, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, "三角 千歌", 2, "そう思っています。", 1, "三角千歌です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1043, 0, 0, 1, 1.4, 0, "あぁ？\nお前のそいつの仲間か？", 1, "安芸 真琴", 2, "う、疑ってすまなかったな…", 1, "安芸真琴だ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1044, 0, 0, 1, 1.4, 0, "生けとし生ける全ての者よ！", 1, "イリヤ・オーンスタイン", 2, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, "わらわこそは夜を総べる者！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1045, 0, 0, 1, 1.4, 0, "ぐふふふふ……はっ！", 1, "遠見 空花", 2, "ｌク、クウカに何かご用ですか!?", 1, "そこで騎士は妖精を乱暴に……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1046, 0, 0, 1, 1.4, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, "宮坂たまき", 2, "う～ん…\n猫ってホントに最高にゃ～♪", 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1048, 0, 0, 1, 1.4, 0, "それでは早速クエストに…", 1, "大神 美冬", 2, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, "大神美冬よ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1049, 0, 0, 1, 1.4, 0, "クエストもバトルも\n掃除も洗濯も", 1, "星野静流", 2, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, "星野静流だよ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1050, 0, 0, 1, 1.5, 0, "見ての通りの\nセクシー美少女で", 1, "玉泉美咲", 2, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, "アタシは玉泉美咲。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1052, 0, 0, 1, 1.4, 0, "？？？？", 1, "リマ", 2, "？？？？", 1, "？？？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1053, 0, 0, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "モニカ・ヴァイスヴィント", 2, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1058, 0, 0, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "ペコリーヌ", 2, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1059, 0, 0, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "コッコロ", 2, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 0, 1060, 0, 0, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", 1, "キャル", 2, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。");
